import React from 'react';
import './styles.scss';

// eslint-disable-next-line react/prop-types
function Hero({ image }) {
  return (
    <div className="hero">
      <img src={image} alt="Hero" className="hero-image" />
      <div className="hero-text">
        <h1>Welcome to Our Garden</h1>
        <p>Explore the beauty of nature.</p>
      </div>
    </div>
  );
}

export default Hero;
